import logo from "./logo.svg";
import "./App.css";

import axios from "axios";
import React, { useEffect, useState } from "react";
import Button from "./UI/Button";

function App() {
  const [vehicles, setVehicles] = useState([]);

  const getVehicles = async () => {
    const { data } = await axios("/vehicles/list");
    console.log(data);
    setVehicles(data);
  };
  const occupyVehicle = () => {
    console.log("occupyVehicleoccupyVehicleoccupyVehicle")
  };


  const renderVehicles = (_vehicles) => {
    return _vehicles.map((v) => {

      return (
        <div className="Occupy-wrapper">
          <p>manufacturer: {v.manufacturer}</p>
          <p>license plate number: {v.license_plate_number}</p>
          <p>
            is available: {v.is_available}
            <div className="buttons-wrapper">
            {console.log("pppp",v.is_available,v.manufacturer)}
            {/* if available=true  Occupy button will showen  */}
            {/* if available=false && user is owner - Release will showen */}
            <Button className ={v.is_available ?"available": "not-available"} onClick={occupyVehicle}>Occupy</Button> 
            {/* <Button className ={v.is_available  ?"available-and-owner": ""}>Release</Button> */}
            </div>
          </p>
        </div>
      );
    });
  };

  useEffect(() => {
    getVehicles();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h2>Vehicles list </h2>
      </header>
      {renderVehicles(vehicles)}
    </div>
  );
}

export default App;
